script: |
  super -f text -I q128.spq | sort > q128.out

inputs:
  - name: q128.spq
    data: |
      SELECT DISTINCT + - col1 / col1 * - col2 + + 48 * - 64 + + + col1, 76 AS col0 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q128.out
    data: |
      -2944	76
      -2972	76
      -3041	76
